import React from 'react'

export default function Passport() {
  return (
    <div>
      <h1>Đăng ký hộ chiếu trực tuyến</h1>
      {/* 
      - Họ tên : text  - giới tính : radio
      - ngày tháng năm sinh : date - nơi sinh : text
      - số CCCD/CMND : number (10 hoặc 12 số) - ngày cấp : date
      - dân tộc : text - tôn giáo : text
      - địa chỉ thường trú : text - số điện thoại : number

      */}
    </div>
  )
}
